import React, { useState } from 'react';
import './landing-page.css'; // Import your CSS file
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faBars,
  faExpand,
  faShoppingCart,
  faHome,
  faTag,
  faUsers,
  faChartBar,
  faBoxes,
  faPercent,
  faCog,
  faQuestionCircle,
} from '@fortawesome/free-solid-svg-icons';

function App() {
  const [sidebarCollapsed, setSidebarCollapsed] = useState(false);
  const [activeCategory, setActiveCategory] = useState('All Products');
  const [activeMenuItem, setActiveMenuItem] = useState('Dashboard');

  const toggleSidebar = () => {
    setSidebarCollapsed(!sidebarCollapsed);
  };

  const handleCategoryClick = (category) => {
    setActiveCategory(category);
  };

  const handleMenuItemClick = (menuItem) => {
    setActiveMenuItem(menuItem);
  };

  const handleCartClick = () => {
    alert('Redirecting to shopping cart...');
    // Use React Router for navigation instead
  };

  const handleProductClick = () => {
    alert('Item added to cart!');
  };

  return (
    <div className="container">
      {/* Top Navigation Bar */}
      <TopNav
        toggleSidebar={toggleSidebar}
        sidebarCollapsed={sidebarCollapsed}
        handleCartClick={handleCartClick}
      />

      {/* Categories Bar */}
      <CategoriesBar
        activeCategory={activeCategory}
        handleCategoryClick={handleCategoryClick}
      />

      {/* Main Area (Sidebar + Main Content) */}
      <div className="main-area">
        {/* Sidebar */}
        <Sidebar
          sidebarCollapsed={sidebarCollapsed}
          activeMenuItem={activeMenuItem}
          handleMenuItemClick={handleMenuItemClick}
        />

        {/* Main Content */}
        <MainContent
          sidebarCollapsed={sidebarCollapsed}
          handleProductClick={handleProductClick}
        />
      </div>
    </div>
  );
}

// Top Navigation Component
function TopNav({ toggleSidebar, sidebarCollapsed, handleCartClick }) {
  return (
    <div className="top-nav">
      <button className="toggle-sidebar" onClick={toggleSidebar} title="Toggle Sidebar">
        <FontAwesomeIcon icon={sidebarCollapsed ? faExpand : faBars} />
      </button>
      <div className="logo">
        <FontAwesomeIcon icon={faShoppingCart} />
        RetailPro
      </div>
      <div className="search-container">
        <div className="search-bar">
          <input type="text" className="search-input" placeholder="Search products by name, SKU, or barcode..." />
          <button className="search-button">
            <FontAwesomeIcon icon="search" />
            <span>Search</span>
          </button>
        </div>
      </div>
      <div className="user-controls">
        <button className="cart-button" onClick={handleCartClick} title="View Shopping Cart">
          <FontAwesomeIcon icon={faShoppingCart} />
        </button>
        <div className="user-info">
          <img src="/api/placeholder/40/40" alt="User avatar" />
          <span>Alex</span>
        </div>
      </div>
    </div>
  );
}

// Categories Bar Component
function CategoriesBar({ activeCategory, handleCategoryClick }) {
  const categories = [
    'All Products',
    'Electronics',
    'Clothing',
    'Home & Kitchen',
    'Toys',
    'Sporting Goods',
    'Business & Industrial',
    'Jewelry & Watches',
    'Refurbished',
  ];

  return (
    <div className="categories-bar">
      {categories.map((category) => (
        <div
          key={category}
          className={`category-tab ${activeCategory === category ? 'active' : ''}`}
          onClick={() => handleCategoryClick(category)}
        >
          {category}
        </div>
      ))}
    </div>
  );
}

// Sidebar Component
function Sidebar({ sidebarCollapsed, activeMenuItem, handleMenuItemClick }) {
  const menuItems = [
    { icon: faHome, label: 'Dashboard' },
    { icon: faTag, label: 'Products' },
    { icon: faShoppingCart, label: 'Shopping Cart' },
    { icon: faUsers, label: 'Customers' },
    { icon: faChartBar, label: 'Reports' },
    { icon: faBoxes, label: 'Inventory' },
    { icon: faPercent, label: 'Discounts' },
    { icon: faCog, label: 'Settings' },
    { icon: faQuestionCircle, label: 'Help' },
  ];

  return (
    <aside className={`sidebar ${sidebarCollapsed ? 'collapsed' : ''}`}>
      <ul className="sidebar-menu">
        {menuItems.map((item) => (
          <li
            key={item.label}
            className={`${activeMenuItem === item.label ? 'active' : ''}`}
            onClick={() => handleMenuItemClick(item.label)}
          >
            <FontAwesomeIcon icon={item.icon} />
            {!sidebarCollapsed && item.label}
          </li>
        ))}
      </ul>
    </aside>
  );
}

// Main Content Component
function MainContent({ sidebarCollapsed, handleProductClick }) {
  const products = [
    { id: 1, name: 'Wireless Headphones', price: 129.99, inventory: 24 },
    { id: 2, name: 'Smart Watch', price: 199.99, inventory: 12 },
    { id: 3, name: 'Bluetooth Speaker', price: 79.99, inventory: 18 },
    { id: 4, name: 'Smartphone Case', price: 24.99, inventory: 56 },
    { id: 5, name: 'Laptop Bag', price: 49.99, inventory: 9 },
    { id: 6, name: 'Wireless Mouse', price: 34.99, inventory: 32 },
  ];

  return (
    <main className={`main-content ${sidebarCollapsed ? 'full-width' : ''}`}>
      <div className="filter-options">
        <div className="filter-label">Sort by:</div>
        <select className="filter-select">
          <option>Newest First</option>
          <option>Price: Low to High</option>
          <option>Price: High to Low</option>
          <option>Best Selling</option>
        </select>
        <div className="filter-label">In Stock:</div>
        <select className="filter-select">
          <option>All Items</option>
          <option>In Stock Only</option>
          <option>Out of Stock</option>
        </select>
      </div>
      <div className="product-grid">
        {products.map((product) => (
          <ProductCard key={product.id} product={product} handleProductClick={handleProductClick} />
        ))}
      </div>
    </main>
  );
}

// Product Card Component
function ProductCard({ product, handleProductClick }) {
  return (
    <div className="product-card" onClick={handleProductClick}>
      <div className="product-image">
        <img src="/api/placeholder/150/150" alt={product.name} />
      </div>
      <div className="product-details">
        <div className="product-title">{product.name}</div>
        <div className="product-price">${product.price.toFixed(2)}</div>
        <div className="product-inventory">In stock: {product.inventory}</div>
      </div>
    </div>
  );
}

export default Landing;
